import React, {useState} from "react";
import {Link} from "react-scroll";


export default function Navigation({startNotActive}) {

    const [toggleMenu, setToggleMenu] = useState(true)

    const handleToggleMenu = () => {
        setToggleMenu(!toggleMenu)
    }

    const handleCloseMenu = () => {
        setToggleMenu(true)
    }

    return (
<>


        <button className="btn btn-a menu-toggle" onclick={handleToggleMenu}>Menu</button>
        <nav className={`mainNav ${toggleMenu ? "" : "active"}`}>
            <Link to="/" onClick>
                <button className="btn btn-a">Start</button>
            </Link>
            <Link to="fourSteps">
                <button className="btn">O co chodzi?</button>
            </Link>
            <Link to="aboutUs" >
                <button className="btn">O nas</button>
            </Link>
            <Link to="whoWeHelp" >
                <button className="btn">Fundacja i organizacje</button>
            </Link>
            <Link to="contact" >
                <button className="btn">Kontakt</button>
            </Link>
        </nav>
        </>
    )
}
